import React, {Fragment} from 'react';


function header(props) {
    return(
        <div className="header_container">
            <p>Hola mundo</p>
            <h1>{ props.titulo }</h1>
            <p>{ props.descripcion }</p>
        </div>
    );
}

export default header;
